function Yqe(a){SBe(a.f,'Welcome! Press enter to get started!');SBe(a.f,'Quicksort is among the fastest sorting algorithms');SBe(a.f,"The first step of Quicksort is to 'partition' the array.");SBe(a.f,'To partition, we select some pivot element within the array.');SBe(a.f,'Different quicksort variants choose the pivot differently.');SBe(a.f,"We'll just use the middle element.");SBe(a.f,Rlf);SBe(a.f,'Click on the middle element to make it the pivot.');SBe(a.f,'Now, the purple element is our pivot.');SBe(a.f,'Our goal is to figure something out about the pivot...');SBe(a.f,"We want to figure out it's correct place in the sorted array.");SBe(a.f,'So, the center might be the wrong (sorted) pivot spot...');SBe(a.f,"We can figure out the pivot's correct spot by 'partitioning'.");SBe(a.f,"So, what exactly is 'partitoning the array'?");SBe(a.f,"Well, basically it's re-arranging elements based on the pivot.");SBe(a.f,'We want elements smaller than the pivot to the left...');SBe(a.f,'...and we want elements bigger than pivot to the right.');SBe(a.f,'Before partitioning, we need to move the pivot out of the way.');SBe(a.f,"Basically, we're hiding the pivot until we know where it goes.");SBe(a.f,'Different quicksort variants hide the pivot in different ways...');SBe(a.f,"We'll just tuck it away at the start of our array sequence.");SBe(a.f,Slf);SBe(a.f,'Drag the pivot to the first element, and release to swap.');SBe(a.f,"So, the pivot's hidden -- but what are those arrow 'pointers'?");SBe(a.f,'The pointers are our place holders while we partition.');SBe(a.f,'In regards to their colors...');SBe(a.f,"Let's say that anything 'red' is 'smaller' than the pivot...");SBe(a.f,'...and anything blue is bigger than the pivot.');SBe(a.f,'So: red = smaller; blue = bigger.');SBe(a.f,"Now, we're going to 'color-code' elements based on size");SBe(a.f,"Let's move red pointer right marking red (smaller) elements");SBe(a.f,Tlf);SBe(a.f,'Like that!');SBe(a.f,'The next element is also smaller than the pivot...');SBe(a.f,'...since it is smaller, it should be red too.');SBe(a.f,Tlf);SBe(a.f,Ulf);SBe(a.f,'You try, click the next element to color code it.');SBe(a.f,"But don't actually think of this as color coding...");SBe(a.f,"What we're really doing is sliding the red pointer.");SBe(a.f,"We're sliding it passed smaller elements...");SBe(a.f,'...searching for a larger element.');SBe(a.f,"The red pointer's element is larger than the purple pivot...");SBe(a.f,'Since it is larger, we should label it blue.');SBe(a.f,Vlf);SBe(a.f,'Continue clicking on the element until it is blue.');SBe(a.f,"Here's where we change things up...");SBe(a.f,'...now we want to slide the blue pointer passed larger elements.');SBe(a.f,"Essentially, it's looking for a smaller-than-pivot element");SBe(a.f,'Since the element at the blue pointer is larger...');SBe(a.f,Wlf);SBe(a.f,'... it needs to be blue; please change its color to blue.');SBe(a.f,'Now the blue pointer has found a smaller element!');SBe(a.f,Xlf);SBe(a.f,'Please label it red, since it is smaller than the pivot.');SBe(a.f,"The moment we've been waiting for! ...");SBe(a.f,'...the two pointers have found their targets.');SBe(a.f,'The next step is to swap the elements at the two pointers! ');SBe(a.f,'Swapping corrects the relative position of the elements...');SBe(a.f,"...we're trying to get all red on the left, and all blue on the right.");SBe(a.f,Ylf);SBe(a.f,"Swap the two pointer's elements (click and drag).");SBe(a.f,'Did you notice the pointers update?');SBe(a.f,'The red pointer moved right, the blue moved left.');SBe(a.f,'Now what? Well, in this case we re-position the pivot.');SBe(a.f,'But normally, we will repeat blue and red pointer scanning.');SBe(a.f,'Normally, we scan again until the pointers cross.');SBe(a.f,'But only when the pointers cross each other...');SBe(a.f,'...do we reposition the pivot into the array.');SBe(a.f,'Now then, since our pointers crossed over each other...');SBe(a.f,"...we're ready to position the pivot!");SBe(a.f,"We need to swap the pivot into it's correct place...");SBe(a.f,'...and the correct place is at one of the pointers.');SBe(a.f,'Can you guess which pointer we will swap with the pivot?');SBe(a.f,'Since we want all red on the left, and all blue on the right...');SBe(a.f,'We will swap with red element currently at the blue pointer...');SBe(a.f,'We do this because we hid the pivot on the left (red) side.');SBe(a.f,Zlf);SBe(a.f,'Swap the pivot with the blue pointer element, please.');SBe(a.f,"We've now completed our first partition!");SBe(a.f,'Quicksort is a recursive algorithm, ...');SBe(a.f,'... which means we recurse(repeat) on smaller subproblems');SBe(a.f,'In this case, we have two smaller subproblems, ...');SBe(a.f,'...our two subproblems are beside our last pivot!');SBe(a.f,"So, let's repeat and partition on both sides of the old pivot.");SBe(a.f,'Starting with the left half, we need a pivot.');SBe(a.f,'When there are two middle elements, choose the left.');SBe(a.f,Rlf);SBe(a.f,'Above the left gray bar, pick the pivot (middle) element.');SBe(a.f,'Now we need to hide the pivot again...');SBe(a.f,"... we're going to hide it to the far left again.");SBe(a.f,"It may seem like we're always hiding it in the leftmost spot...");SBe(a.f,'...but we can only hide it within the current subproblem...');SBe(a.f,'... which means always hide the pivot within the gray bar');SBe(a.f,Slf);SBe(a.f,'Now, hide the pivot on the far left (swap).');SBe(a.f,'Now we need to label elements red again...');SBe(a.f,'... the first scan always starts at the red pointer...');SBe(a.f,'we mark elements red until reaching a bigger element');SBe(a.f,Vlf);SBe(a.f,'Scan over all the red elements, and mark the last one blue.');SBe(a.f,'Nice! now time to start our left scan...');SBe(a.f,'The second scan always starts at the blue pointer...');SBe(a.f,'...and moves left, marking blue elements...');SBe(a.f,'...until it reaches a red element.');SBe(a.f,Xlf);SBe(a.f,'From blue pointer, label larger elements blue.');SBe(a.f,"This time we don't need to swap the pointers...");SBe(a.f,'...the blue pointer has already passed the red pointer');SBe(a.f,'When our pointers cross places, it is time to position the pivot.');SBe(a.f,'Remember, every time move the pivot out of hiding...');SBe(a.f,'...we move it to the spot of the blue pointer.');SBe(a.f,Zlf);SBe(a.f,'Now then, correctly position pivot into the subproblem.');SBe(a.f,'We just completed another partitioning...');SBe(a.f,'...which means we are done with this subproblem.');SBe(a.f,'notice our new pivot split the region into two halves.');SBe(a.f,'Now we need to pick a pivot one of these subproblems.');SBe(a.f,'Notice the gray underline only covers 1 element.');SBe(a.f,'This means we have a subproblem size of 1.');SBe(a.f,'So, we only have 1 element to pick a pivot from...');SBe(a.f,'...which means this element is already correctly positioned!');SBe(a.f,'This is what we call a base case...');SBe(a.f,'Base cases are essentially the end the of recursion.');SBe(a.f,$lf);SBe(a.f,'Please click the one element to label purple.');SBe(a.f,'Now we only have two elements above the gray bar...');SBe(a.f,'...which is another base case!');SBe(a.f,"Again, we don't need to recursively partition anymore.");SBe(a.f,"We only need to swap the two if they're out of order.");SBe(a.f,$lf);SBe(a.f,"Since these two are out of order, let's swap the elements..");SBe(a.f,"Again we're presented with the two element base case.");SBe(a.f,$lf);SBe(a.f,"They're out of order, so let's swap.");SBe(a.f,'And we have it, the entire array has been sorted!');SBe(a.f,"Now that you've seen the basics...");SBe(a.f,"...you're ready to try some more challenging arrays.");SBe(a.f,"If you get stuck, press 'enter' to see the next step...");SBe(a.f,'I suggest letting the computer solve the first one...');SBe(a.f,'...it may help to see how it is done quickly.');SBe(a.f,'But after a few, try to solve the steps on your own.');SBe(a.f,"Press 'space' at any
